import React from "react";
import  './Button.style.css';
import ArrowLeft from "../../../icons/ArrowLeft.svg";

const Button = () => {
    return <button className='button'>
        <img src={ArrowLeft} style={{ width: "24px" }} alt='Left'/>
    </button>
};

export default Button;
